import React from "react"
export default function MainComponent()
{
    return (
    <div className="Mains" style ={{backgroundImage:'url("/rockets.jpeg")',
        backgroundRepeat:"no-repeat",
        backgroundSize:"cover",

    }}>
        <h1>To-Do list for new Students</h1>

        <ol>
                <li>Check in at OISS(Office of International Students and Services)</li>
                <li>Get a free sim card in the office of OISS/ order one online</li>
                <li>Create a bank account</li>
                <li>Get a job on campus by contacting the hiring manager</li>
                <li>Call(800) 447-3333 to make an electricity account & transfer it to your name </li>
                <li> Contact any fellow brother/sister before making any important decision, they are always willing to help</li>
        </ol>

    </div>
    )    
}
